import { useNavigate, Link } from "react-router-dom";

export default function Portal({ user, setUser }) {
  const navigate = useNavigate();
  const isAuthenticated = Boolean(user?.email) || Boolean(user?.user?.email);
  console.log("auth?", isAuthenticated)

  console.log("User", user);

  const show = isAuthenticated ? (
    <>
      <div className="banner">
        <h1> Activity Feed</h1>

        <div className="buttons">
          <button className="button"> Add exercise</button>
          <button className="button"> Log Sleep</button>
          <button className="button">Record Nutrition</button>
        </div>
      </div>

      <div className="tabs">
        <div className="tab">
          Nutrition 0
        </div>
        <div className="tab">
          Sleep 0
        </div>

        <div className="tab">
          Exercise 0
        </div>
      </div>

    </>
  ) : (
    <div> Log in to view your portal</div>
  );
  return <>{show}</>;
}
